import React from "react";
import Dog from "react-svg-loader!../../public/dog2.svg";

const Header = () => {
  return (
    <div className="header">
      <h1>
        adoptuj<span>zwierzaka</span>.pl
      </h1>
      <div className="wrapper">
        <Dog className="svg" />
      </div>

      <style jsx>
        {`
          .header {
            height: 100vh;
            background: rgb(170, 209, 93);
            background: url("/header-stain.png"),
              linear-gradient(
                74deg,
                rgba(170, 209, 93, 1) 0%,
                rgba(109, 190, 69, 1) 81%,
                rgba(7, 153, 72, 1) 100%
              );
            background-repeat: no-repeat;
            background-size: 50%;
          }

          h1 {
            font-size: 40px;
          }

          h1 span {
            color: var(--main-color);
          }

          .wrapper {
            width: 350px;
          }
        `}
      </style>
    </div>
  );
};

export default Header;
